import React, {ReactElement} from 'react'
import styled from 'styled-components'


const Mono = styled.h1`
  color: red;
  font-size: 50px;
`

interface TitleProps {
  fingerPrint: string
}

export default function Title({fingerPrint}: TitleProps): ReactElement {

  return (
      <Mono>{fingerPrint}</Mono>
        )
}
